import React from "react";
import DeleteIcon from '@material-ui/icons/Delete';

const ListCom = (props) => {
    return (
        <div className="todo_style">
            <span onClick="deleteItem">
                <DeleteIcon className="deleteIcon" />
            </span>
            <li >{props.text}</li>
        </div>
    );
    
};
export default ListCom;
